chest_locations = {}


chests = {}

init_done = false

start = false

row = 1
pixel = 1

right_side = true

function increment_counters()
    pixel = pixel + 1
    if pixel > 128 then
        start = false
    end
    
end

function place_item()
    for set = 1, 32 do
        for row = 1+(set*4-4), 2+(set*4-4) do
            chests[row].insert{name=items[row][pixel], count=2}
        end
        for row = 3+(set*4-4), 4+(set*4-4) do
            chests[row].insert{name=items[row][129 - pixel], count=2}
        end
    end

    --game.print("placing "..items[row][pixel].."at row "..row)
    
    increment_counters()
end



script.on_event(defines.events.on_tick, function(event)
    if game.tick%10 == 0 then
        if init_done == false then
            init_done = true
            game.print("init starting")
            
            for y_val = -39.5, 23.5 do
                if right_side == true then
                    table.insert(chest_locations, {35.5,y_val})
                    table.insert(chest_locations, {31.5,y_val})
                    right_side = false
                else
                    table.insert(chest_locations, {-47.5,y_val})
                    table.insert(chest_locations, {-43.5,y_val})
                    right_side = true
                end
                
            end
            for chestCount = 1, 128 do
              chests[chestCount] = game.surfaces[1].find_entity('steel-chest',chest_locations[chestCount])
            end
            game.print("init done")
            
        end
        --game.print(game.tick)
        --game.print(chests[1].get_inventory(1).is_empty())
        if start == true then
            all_chests_empty = true
                for chestCount = 1, 128 do 
                    if chests[chestCount].get_inventory(1).is_empty() == false then
                        all_chests_empty = false
                    end
                end
            if all_chests_empty == true then
                place_item()
            end
        end
    end
end)


